import struct

def stuff_with_export_entry(sub_entry, string_length):
	output = bytearray()
	for i in range(256):
		output += b'%c' % (i)
	output += '\x00' #output[256] = 0;
	output += '\x00' #output[257] = 0;
	
	v = 0
	for i in range(256) :
		v += int(sub_entry[i % string_length] + output[i])
		v &= 0xff
		output[i], output[v] = output[v], output[i] #swap
	
	return output
	
def decrypt_code_block(block, code, code_size) :
	code_cp = code
	for i in range(code_size):
		block[256] = (block[256] + 1) & 0xff
		block[257] = (block[257] + block[block[256]]) & 0xff
		block[block[256]], block[block[257]] = block[block[257]], block[block[256]]
		res = block[(block[block[257]] + block[block[256]]) & 0xff]
		code[i] = res ^ code[i]
	return code

